maps.script:
addTriggerOnceListener(
    getMask('EndLevel trigger'),
    function() {
        switchToMap('Tutorial #1');
    }
);

bindOnStartPlaying(function() {
    var wallsOpeningDelay = 30;

    delay(function() {
        paint(getMask('Blocks to remove'), 'Empty');
    }, wallsOpeningDelay);

    for(var i = 0; i < 4; i++) {
        delay(
            paint.bind(
                undefined,
                getMask('Hallway walls #' + i),
                'Wall'
            ),
            wallsOpeningDelay + 1 + i
        );
    }
});

var spawnInterval = 20;

function startBallSpawner(id) {
    function spawn() {
        spawnBallAtMarker(getMarker('Spawner #' + id));
        delay(spawn, spawnInterval);
    }
    spawn();
}

for(var i = 0; i < 3; i++) {
    delay(startBallSpawner.bind(undefined, i), 4*i);
}

addTriggerOnceListener(
    getMask('EndLevel trigger'),
    function() {
        switchToMap('Balls #2');
    }
);

function startBallsSpawnerGroup(groupID, spawnerCount, interval) {
    function spawnBalls() {
        for(var i = 0; i < spawnerCount; i++) {
            spawnBallAtMarker(getMarker(
                'Spawner (group ' + groupID +') #' + i
            ));
        }
        delay(spawnBalls, interval);
    }
    spawnBalls();
}

startBallsSpawnerGroup(0, 2, 8);
delay(function() {
    startBallsSpawnerGroup(1, 3, 12);
}, 3);
delay(function() {
    startBallsSpawnerGroup(2, 1, 16);
}, 6);

addTriggerOnceListener(
    getMask('EndLevel trigger'),
    function() {
        openMainMenu();
    }
);
